webpackJsonp([0xc711672ee29e],{6276:function(e,t){e.exports={data:{post:{html:"<p>It's going to be warm again today, so we're heading for the <a href=\"http://www.travemuende.de\">beach</a> (early, so we beat the traffic). </p>\n<p>Christopher is still asking to see the Springsteen video to watch Bruce slide. Is he too young to be watching music videos? Not if it's <em>good</em> music.</p>\n<p>I, too, was a <a href=\"http://www.typepad.com/\">TypePad</a> <a href=\"http://papascott.typepad.com/\">beta tester</a>. I didn't look at it that closely, since I'm not looking to replace my present hoster (namely, me). But I did make a couple suggestions in regards to color-blind users. They're opening up to the general public tomorrow, and if anyone wants a 20% discount for 'friends of beta-testers', let me know and say you're my friend. I'm allowed to have 20 friends.</p>",fields:{title:"Beach Day",date:"03 Aug 2003",url:"https://papascott.de/2003-08-03-beach-day/"}}},pathContext:{slug:"/2003-08-03-beach-day/",prev:{fields:{title:"US health care, you can't beat the system, so just join it",date:"02 Aug 2003",slug:"/2003-08-02-us-health-care-you-cant-beat-the-system-so-just-join-it/"}},next:{fields:{title:"How to install Windows XP in 5 hours or less",date:"04 Aug 2003",slug:"/2003-08-04-how-to-install-windows-xp-in-5-hours-or-less/"}}}}}});
